INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 0, 1, 1, 1, 110, 1, 160, 105, 122601, 101, 0, 0.029, 1.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 1, 2, 2, 0, 105, 3, 120, 111, 122401, 102, 0, 0.014, 2.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 0, 3, 3, 0, 110, 2, 350, 105, 122501, 103, 1, 0.017, 2.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 1, 4, 4, 0, 110, 3, 130, 105, 107501, 104, 0, 0.016, 1.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 0, 5, 5, 1, 110, 1, 160, 105, 107601, 105, 0, 0.014, 2.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 0, 6, 6, 0, 120, 2, 255, 103, 107801, 106, 1, 0.029, 3.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 0, 7, 7, 1, 120, 1, 160, 103, 110601, 107, 0, 0.013, 3.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 0, 8, 8, 0, 110, 2, 350, 103, 110401, 108, 1, 0.014, 2.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 1, 9, 9, 0, 105, 3, 130, 100, 110501, 109, 0, 0.012, 1.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 0, 10, 10, 1, 105, 1, 200, 103, 115701, 110, 0, 0.014, 2.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 0, 11, 11, 0, 105, 2, 350, 103, 113601, 111, 1, 0.071, 2.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 1, 12, 12, 0, 120, 3, 130, 103, 107901, 112, 0, 0.014, 1.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 0, 13, 13, 1, 110, 2, 200, 105, 108001, 113, 0, 0.022, 1.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 0, 14, 14, 1, 110, 1, 160, 108, 110301, 114, 0, 0.031, 2.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 1, 15, 15, 0, 110, 1, 130, 105, 107701, 115, 0, 0.036, 0.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 0, 16, 16, 0, 110, 2, 350, 95, 113101, 116, 1, 0.048, 3.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 1, 17, 17, 0, 105, 3, 130, 105, 113301, 117, 0, 0.043, 1.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 1, 18, 18, 0, 105, 2, 130, 95, 113201, 118, 0, 0.018, 1.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 0, 19, 19, 1, 110, 2, 160, 108, 117001, 119, 0, 0.021, 2.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 0, 20, 20, 0, 110, 1, 255, 105, 113501, 120, 1, 0.036, 2.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 0, 21, 21, 0, 105, 3, 350, 105, 113401, 121, 1, 0.02, 2.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 1, 22, 22, 0, 110, 1, 130, 105, 110101, 122, 0, 0.018, 2.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 0, 23, 23, 1, 105, 3, 160, 111, 110001, 123, 0, 0.03, 3.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 1, 24, 24, 0, 110, 1, 130, 103, 117201, 124, 0, 0.027, 1.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 0, 25, 25, 1, 105, 2, 160, 108, 117301, 125, 0, 0.02, 3.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 0, 26, 26, 0, 110, 3, 350, 105, 117401, 126, 1, 0.04, 2.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 0, 27, 27, 0, 110, 1, 350, 105, 117101, 127, 1, 0.009, 3.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 0, 28, 28, 0, 120, 1, 255, 105, 122901, 128, 1, 0.022, 3.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 1, 29, 29, 0, 110, 3, 130, 105, 122801, 129, 0, 0.028, 2.5);
INSERT INTO `v1_3fa07c4edb49c9f0b7633927ff8d30b331e82fd17f37bc7da849b07076873ec1` VALUES ("海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 0, 30, 30, 1, 105, 2, 130, 108, 122701, 130, 0, 0.023, 3.5);
